import React, { useState, useEffect } from "react";
// css
import { CancelIcon, SendIcon } from "mdi-react";
// components 
import Warning from "./ui/Warning";
import TextInput from "./ui/TextInput";
import TextArea from "./ui/TextArea";
import FormButton from "./ui/FormButton";

const CreateAccount = props => {
    const [createAccount, setCreateAccount] = useState(false);
    const [createAccountName, setCreateAccountName] = useState("");
    const [createAccountPassword, setCreateAccountPassword] = useState("")
    const [createAccountAge, setCreateAccountAge] = useState("");
    const [createAccountText, setCreateAccountText] = useState("");
    const [createAccountOccupation, setCreateAccountOccupation] = useState("");
    const [createAccountRegion, setCreateAccountRegion] = useState("");
    
    const [valName, setValName] = useState();
    const [valPassword, setValPassword] = useState();
    const [valAge, setValAge] = useState();
    const [valOccupation, setValOccupation] = useState();
    const [valRegion, setValRegion] = useState();
    const [valText, setValText] = useState();

    const handleFormChange = () => {}

    return <>
        <form>
            <h1>Opret bruger</h1>
            <h2>Navn</h2>
            <TextInput
                name="createAccountName"
                value={createAccountName}
                handleChange={handleFormChange}
                initText="Navn"
            />
            <Warning validationText={valName}/> 
            <h2>Password</h2>
            <TextInput
                name="createAccountPassword"
                value={createAccountPassword}
                handleChange={handleFormChange}
                initText="Kodeord"
            />

        </form>
    </> 
}

export default CreateAccount;
